import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';
import { SharedModule } from 'app/shared/shared.module';
import { TableModule } from 'primeng/table';
import { ButtonModule } from 'primeng/button';
import { JobExecutionService, JobExecutionPopupService, JobExecutionComponent, jobExecutionRoute, JobExecutionDetailComponent, JobExecutionExitMessageDialogComponent } from './';
import {MultiSelectModule} from "primeng/multiselect";

const ENTITY_STATES = [...jobExecutionRoute];

@NgModule({
  imports: [
    SharedModule,
    TableModule,
    ButtonModule,
    MultiSelectModule,
    RouterModule.forChild(ENTITY_STATES)],
  declarations: [JobExecutionComponent, JobExecutionDetailComponent, JobExecutionExitMessageDialogComponent],
  entryComponents: [JobExecutionComponent],
  providers: [JobExecutionService, JobExecutionPopupService],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class JobWebJobExecutionModule {}
